import Head from 'next/head';

const Layout = ({children}) => {
    const head = () => (
        <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css" integrity="sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm" crossorigin="anonymous"></link>
    );
    const nav = () =>  (
        <>
        <ul className="nav nav-tabs bg-warning">
            <li className="nav-item"><a className="nav-link text-dark" href="../pages/index.js">Home</a></li>
            <li className="nav-item"><a className="nav-link text-dark" href="../pages/login.js">Login</a></li>
            <li className="nav-item"><a className="nav-link text-dark" href="../pages/register.js">Register</a></li>
        </ul>
        </>
    );
    return (
        <>
        {head()} {nav()} <div className="container pt-5 pb-5" >{children}</div> 
    </>);
};

export default Layout;
